import { useState } from "react";

import Edit from "./components/Edit.js";
import List from "./components/List.js";
import "./index.css";

const Home = () => {
  const [data, setData] = useState([]);

  return (
    <div className="app">
      <Edit add={setData} />
      <List listData={data} deleteData={setData} />
    </div>
  );
};

export default Home;
